    ml: 'ബഡ. ക്രമീകരണങ്ങൾ> ഫോണിനെക്കുറിച്ച് (മുമ്പ് "എന്നതിനെക്കുറിച്ച്" ക്രമീകരണത്തിലേക്ക് പോകുക). ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകൾക്ക് മോഡൽ പേരും നമ്പറും പകർത്തുക.',
