    fi: "Kämmen. Siirry Asetukset- tai Asetukset -valikkoon, vieritä luettelon alaosaan ja tarkista 'About About Phone', 'About Laite' tai vastaava. Kopioi mallin nimi ja numero alla oleviin vastaaviin kenttiin.",
    fr: "PALMIER. Accédez au menu Paramètres ou Options, faites défiler vers le bas de la liste et vérifiez «sur le téléphone», «sur l'appareil» ou similaire. Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.",
    de: 'PALME. Gehen Sie zum Menü oder Optionen für die Einstellungen oder Optionen, scrollen Sie nach unten in der Liste und überprüfen Sie "Über Telefon", "Über Gerät" oder ähnlich. Kopieren Sie den Modellnamen und die Nummer in die entsprechenden Felder unten.',
    el: 'ΠΑΛΑΜΗ. Μεταβείτε στο μενού Ρυθμίσεις ή επιλογές, μετακινηθείτε στο κάτω μέρος της λίστας και ελέγξτε το "Σχετικά με το τηλέφωνο", "Σχετικά με τη συσκευή" ή παρόμοια. Αντιγράψτε το όνομα και τον αριθμό του μοντέλου στα αντίστοιχα πεδία παρακάτω.',
