    fi: 'Napauta tarvittaessa kolme pystysuoraa pistettä oikeassa yläkulmassa paljastaaksesi osoitepalkin. Napauta osoitepalkin URL -osoitetta. Napauta "Go" -näppäintä päivittääksesi verkkosivua.\n',
    fr: "Si nécessaire, appuyez sur les trois points verticaux dans le coin supérieur droit pour révéler la barre d'adresse. Appuyez sur l'URL dans la barre d'adresse. Appuyez sur la touche \"Go\" pour actualiser la page Web.\n",
    de: 'Tippen Sie bei Bedarf in die drei vertikalen Punkte in der oberen rechten Ecke, um die Adressleiste anzuzeigen. Tippen Sie auf die URL in der Adressleiste. Tippen Sie auf die Taste "Go", um die Webseite zu aktualisieren.\n',
    el: 'Εάν είναι απαραίτητο, πατήστε τις τρεις κατακόρυφες κουκίδες στην επάνω δεξιά γωνία για να αποκαλύψετε τη γραμμή διευθύνσεων. Πατήστε τη διεύθυνση URL στη γραμμή διευθύνσεων. Πατήστε το πλήκτρο "GO" για να ανανεώσετε την ιστοσελίδα.\n',
    he: 'במידת הצורך, הקש על שלוש הנקודות האנכיות בפינה השמאלית העליונה כדי לחשוף את סרגל הכתובות. הקש על כתובת האתר בסרגל הכתובות. הקש על מקש "עבור" כדי לרענן את דף האינטרנט.\n',
    hi: 'यदि आवश्यक हो, तो एड्रेस बार को प्रकट करने के लिए शीर्ष-दाएं कोने में तीन ऊर्ध्वाधर डॉट्स पर टैप करें। URL को एड्रेस बार में टैप करें। वेब पेज को रिफ्रेश करने के लिए "गो" कुंजी पर टैप करें।\n',
    hu: 'Ha szükséges, érintse meg a jobb felső sarokban lévő három függőleges pontot, hogy felfedje a címsorot. Érintse meg az URL -t a címsorban. Érintse meg a "GO" gombot a weboldal frissítéséhez.\n',
    is: "Ef nauðsyn krefur, bankaðu á lóðrétta punkta þrjá efst í hægra horninu til að afhjúpa heimilisfangastikuna. Pikkaðu á slóðina á heimilisfangastikunni. Pikkaðu á „GO“ takkann til að hressa upp á vefsíðuna.\n",
    id: 'Jika perlu, ketuk tiga titik vertikal di sudut kanan atas untuk mengungkapkan bilah alamat. Ketuk URL di bilah alamat. Ketuk tombol "GO" untuk menyegarkan halaman web.\n',
    it: "Se necessario, toccare i tre punti verticali nell'angolo in alto a destra per rivelare la barra degli indirizzi. Tocca l'URL nella barra degli indirizzi. Tocca il tasto \"GO\" per aggiornare la pagina Web.\n",
    ja: "必要に応じて、右上隅の3つの垂直ドットをタップして、アドレスバーを表示します。アドレスバーのURLをタップします。 「GO」キーをタップして、Webページを更新します。\n",
    kn: 'ಅಗತ್ಯವಿದ್ದರೆ, ವಿಳಾಸ ಪಟ್ಟಿಯನ್ನು ಬಹಿರಂಗಪಡಿಸಲು ಮೇಲಿನ-ಬಲ ಮೂಲೆಯಲ್ಲಿರುವ ಮೂರು ಲಂಬ ಚುಕ್ಕೆಗಳನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ. ವಿಳಾಸ ಪಟ್ಟಿಯಲ್ಲಿ URL ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ. ವೆಬ್ ಪುಟವನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಲು "ಗೋ" ಕೀಲಿಯನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.\n',
    ko: '필요한 경우 오른쪽 상단 모서리에있는 세 개의 세로 점을 탭하여 주소 표시 줄을 표시하십시오. 주소 표시 줄에서 URL을 누릅니다. 웹 페이지를 새로 고침하려면 "GO"키를 누릅니다.\n',
    lt: "Jei reikia, bakstelėkite tris vertikalius taškus viršutiniame dešiniajame kampe, kad būtų atskleista adreso juosta. Bakstelėkite URL adresų juostoje. Norėdami atnaujinti tinklalapį, bakstelėkite mygtuką „Eik“.\n",
    ms: 'Jika perlu, ketik tiga titik menegak di sudut kanan atas untuk mendedahkan bar alamat. Ketik URL di bar alamat. Ketik kekunci "Pergi" untuk menyegarkan semula laman web.\n',
    no: 'Hvis nødvendig, trykk på de tre vertikale prikkene i øverste høyre hjørne for å avsløre adressefeltet. Trykk på nettadressen i adressefeltet. Trykk på "Go" -tasten for å oppdatere websiden.\n',
    fa: 'در صورت لزوم ، روی سه نقطه عمودی در گوشه بالا سمت راست ضربه بزنید تا نوار آدرس را فاش کنید. روی URL در نوار آدرس ضربه بزنید. برای تازه کردن صفحه وب ، به کلید "برو" ضربه بزنید.\n',
    pl: "W razie potrzeby dotknij trzech pionowych kropek w prawym górnym rogu, aby odsłonić pasek adresu. Stuknij adres URL w pasku adresu. Stuknij klawisz „Go”, aby odświeżyć stronę internetową.\n",
    pt: 'Se necessário, toque nos três pontos verticais no canto superior direito para revelar a barra de endereço. Toque no URL na barra de endereço. Toque na tecla "GO" para atualizar a página da web.\n',
    ro: "Dacă este necesar, atingeți cele trei puncte verticale din colțul din dreapta sus pentru a dezvălui bara de adrese. Atingeți adresa URL în bara de adrese. Atingeți tasta „Go” pentru a reîmprospăta pagina web.\n",
