    ml: 'ഓപ്പറ മെനു തുറക്കുന്നതിന് ചുവടെ മെനുവിൽ "O" ലോഗോ ടാപ്പുചെയ്യുക. പേജ് പുതുക്കുന്നതിന് വിലാസ ബാറിൽ സ്ഥിതിചെയ്യുന്ന വൃത്താകൃതിയിലുള്ള അമ്പടയാള ഐക്കൺ ടാപ്പുചെയ്യുക.',
