    hy: "Հպեք «O» պատկերանշանը ներքեւի ցանկում `օպերայի ընտրացանկը բացելու համար: Հպեք շրջանաձեւ սլաքի պատկերակին ⤾ Տեղակայված է Հասցեի բարում, էջը թարմացնելու համար:",
    bg: 'Докоснете логото "O" в долното меню, за да отворите менюто Opera. Докоснете иконата на кръговата стрелка ⤾, разположена в адресната лента, за да опресните страницата.',
    "zh-CN":
      "点击底部菜单中的“ O”徽标以打开Opera菜单。点击位于地址栏中的圆形箭头图标⤾以刷新页面。",
    "zh-HK":
      "點擊底部菜單中的“ O”徽標以打開Opera菜單。點擊位於地址欄中的圓形箭頭圖標⤾以刷新頁面。",
    hr: 'Dodirnite logo "O" u donjem izborniku da biste otvorili izbornik Opera. Dodirnite ikonu kružne strelice ⤾ Smještena na adresnoj traci da biste osvježili stranicu.',
