    id: 'Ketuk logo "O" di menu bawah untuk membuka menu Opera. Ketuk ikon panah melingkar ⤾ Terletak di bilah alamat untuk menyegarkan halaman.',
    it: "Tocca il logo \"O\" nel menu in basso per aprire il menu dell'opera. Tocca l'icona della freccia circolare ⤾ situata nella barra degli indirizzi per aggiornare la pagina.",
