    ko: '하단 메뉴에서 "O"로고를 탭하여 오페라 메뉴를 엽니 다. 주소 표시 줄에있는 원형 화살표 아이콘을 탭하여 페이지를 새로 고칩니다.',
    lt: "Norėdami atidaryti „Opera“ meniu, bakstelėkite „O“ logotipą apatiniame meniu. Norėdami atnaujinti puslapį, bakstelėkite apskrito rodyklės piktogramą ⤾, esančią adresų juostoje.",
    ms: 'Ketik logo "O" di menu bawah untuk membuka menu Opera. Ketik ikon anak panah pekeliling ⤾ Terletak di bar alamat untuk menyegarkan halaman.',
    no: 'Trykk på "O" -logoen i nederste meny for å åpne opera -menyen. Trykk på Circular Arrow -ikonet ⤾ Ligger i adresselinjen for å oppdatere siden.',
