    pl: "Stuknij logo „O” w dolnym menu, aby otworzyć menu Opera. Stuknij ikonę okrągłej strzałki ⤾ Znajduje się na pasku adresu, aby odświeżyć stronę.",
    pt: 'Toque no logotipo "O" no menu inferior para abrir o menu da ópera. Toque no ícone de seta circular ⤾ Localizada na barra de endereço para atualizar a página.',
    ro: "Atingeți sigla „O” din meniul de jos pentru a deschide meniul Opera. Atingeți pictograma săgeată circulară ⤾ situată în bara de adrese pentru a reîmprospăta pagina.",
    ru: "Нажмите логотип «O» в нижнем меню, чтобы открыть меню оперы. Нажмите на значок круглой стрелки ⤾ Расположен в адресной панели, чтобы обновить страницу.",
    sr: 'Додирните логотип "О" у доњем менију да бисте отворили мени Опера. Додирните Цуркуларну икону стрелице ⤾ Смјештено у адресној траци да бисте освежили страницу.',
