    tl: "Tapikin ang tatlong pahalang na tuldok sa ilalim na menu (Android) o tatlong pahalang na linya (iOS) upang ipakita ang address bar. Tapikin ang pabilog na icon ng arrow ⤾ na matatagpuan sa address bar upang i -refresh ang pahina.",
