    hy: "Հպեք երեք հորիզոնական կետերը ներքեւի ընտրացանկում (Android) կամ երեք հորիզոնական գծեր (iOS), հասցեների բարը բացահայտելու համար: Հպեք շրջանաձեւ սլաքի պատկերակին ⤾ Տեղակայված է Հասցեի բարում, էջը թարմացնելու համար:",
