    "zh-CN":
      "点击底部菜单（Android）或三个水平线（IOS）中的三个水平点以显示地址栏。点击位于地址栏中的圆形箭头图标⤾以刷新页面。",
    "zh-HK":
      "點擊底部菜單（Android）或三個水平線（IOS）中的三個水平點以顯示地址欄。點擊位於地址欄中的圓形箭頭圖標⤾以刷新頁面。",
    hr: "Dodirnite tri vodoravne točke u donjem izborniku (Android) ili tri vodoravne linije (iOS) da biste otkrili adresnu traku. Dodirnite ikonu kružne strelice ⤾ Smještena na adresnoj traci da biste osvježili stranicu.",
    cs: "Klepnutím na tři vodorovné tečky ve spodní nabídce (Android) nebo tři vodorovné čáry (IOS) odhalíte adresní řádek. Klepnutím na ikonu kruhové šipky ⤾ Nachází se v adresním řádku a obnovte stránku.",
    da: "Tryk på de tre vandrette prikker i bundmenuen (Android) eller tre vandrette linjer (iOS) for at afsløre adresselinjen. Tryk på det cirkulære pilikon ⤾ placeret i adresselinjen for at opdatere siden.",
    nl: "Tik op de drie horizontale stippen in het onderste menu (Android) of drie horizontale lijnen (iOS) om de adresbalk te onthullen. Tik op het cirkelvormige pijlpictogram ⤾ in de adresbalk om de pagina te vernieuwen.",
