    el: "Πατήστε τις τρεις οριζόντιες κουκίδες στο κάτω μενού (Android) ή τρεις οριζόντιες γραμμές (iOS) για να αποκαλύψετε τη γραμμή διευθύνσεων. Πατήστε το εικονίδιο κυκλικού βέλους ⤾ που βρίσκεται στη γραμμή διευθύνσεων για να ανανεώσετε τη σελίδα.",
