    hu: "A címsor feltárásához érintse meg az alsó menü (Android) vagy három vízszintes vonal (iOS) három vízszintes pontját. Érintse meg az oldal frissítéséhez a Circular Arrow ikont ⤾ ⤾ ⤾ ⤾ A címsorban található.",
    is: "Pikkaðu á þrjá lárétta punkta í botnvalmyndinni (Android) eða þremur láréttum línum (iOS) til að sýna heimilisfangastikuna. Pikkaðu á hringlaga örvatáknið ⤾ staðsett á heimilisfangastikunni til að endurnýja síðuna.",
