    cs: "Chcete -li se zúčastnit, nasměrujte kameru telefonu na níže uvedený QR kód a klepněte na odkaz, který se zobrazí na displeji vašeho telefonu.",
    da: "For at deltage skal du pege din telefons kamera på QR -koden nedenfor, og tryk på det link, der vises i din telefons display.",
