      "TO PARTICIPATE, point your phone's camera at the QR code below, and tap the link that appears in your phone's display.",
    fi: "Osallistuaksesi puhelimesi kamera alla olevaan QR -koodiin ja napauta puhelimen näytössä näkyvää linkkiä.",
