    de: "Zeigen Sie zur Teilnahme auf die Kamera Ihres Telefons auf den folgenden QR -Code und tippen Sie auf den Link, der in der Anzeige Ihres Telefons angezeigt wird.",
    el: "Για να συμμετάσχετε, τοποθετήστε την κάμερα του τηλεφώνου σας στον παρακάτω κωδικό QR και πατήστε το σύνδεσμο που εμφανίζεται στην οθόνη του τηλεφώνου σας.",
    he: "כדי להשתתף, כוון את המצלמה של הטלפון שלך בקוד ה- QR למטה, והקש על הקישור המופיע בתצוגה של הטלפון שלך.",
    hi: "भाग लेने के लिए, अपने फोन के कैमरे को नीचे दिए गए क्यूआर कोड पर इंगित करें, और आपके फ़ोन के डिस्प्ले में दिखाई देने वाले लिंक पर टैप करें।",
    hu: "A részvételhez mutassa meg a telefon kameráját az alábbi QR -kódra, és koppintson a telefon kijelzőjén megjelenő linkre.",
    is: "Til að taka þátt skaltu benda myndavél símans á QR kóðann hér að neðan og pikkaðu á hlekkinn sem birtist á skjá símans.",
