    hy: "⚠ Քանի որ այս ուսումնասիրությունը կալիբրացնում է միկրոֆոնները (_calibrateOundmicrophonebool == ճշմարիտ), ձեզ հարկավոր կլինի USB միկրոֆոն (MiniDSP Umik-1 կամ Umik-2) `ձեր բարձրախոսները տրամաչափելու համար:",
    bg: "⚠ Тъй като това проучване ще калибрира микрофони (_calibratesoundmicrophonesbool == true), ще ви е необходим USB микрофон (MinIDSP Umik-1 или Umik-2), за да калибрирате вашите високоговорители.",
