    he: "⚠ מכיוון שמחקר זה יכיל את המיקרופונים (_calibratesoundMicrophonesbool == True), תזדקק למיקרופון USB (MinIDSP UMIK-1 או UMIK-2) כדי לכייל את הרמקולים שלך.",
