    kn: "The ಈ ಅಧ್ಯಯನವು ಮೈಕ್ರೊಫೋನ್ಗಳನ್ನು ಮಾಪನಾಂಕ ಮಾಡುತ್ತದೆ (_ಕ್ಯಾಲಿಬ್ರೇಟ್ಸೌಂಡ್‌ಮೈಕ್ರೊಫೋನ್‌ಬೂಲ್ == ನಿಜ), ನಿಮ್ಮ ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನಾಂಕ ಮಾಡಲು ನಿಮಗೆ ಯುಎಸ್‌ಬಿ ಮೈಕ್ರೊಫೋನ್ (ಮಿನಿಡ್‌ಸ್ಪಿ ಯುಎಂಐಸಿ -1 ಅಥವಾ ಉಮಿಕ್ -2) ಅಗತ್ಯವಿರುತ್ತದೆ.",
    ko: "⚠이 연구는 마이크를 교정 할 것이기 때문에 (_calibratesoundmicrophonesbool == true), 라우드 스피커를 보정하려면 USB 마이크 (Minidsp UMIK-1 또는 UMIK-2)가 필요합니다.",
    lt: "⚠ Kadangi šis tyrimas sukalibruos mikrofonus (_CalibratesoundmicrofonesBool == TRUE), jums reikės USB mikrofono („MiniDSP UMIK-1“ arba „UMIK-2“), kad galėtumėte kalibruoti garsiakalbius.",
    ms: "⚠ Oleh kerana kajian ini akan menentukur mikrofon (_calibratesoundmicrophonesbool == benar), anda memerlukan mikrofon USB (MINIDSP UMIK-1 atau UMIK-2) untuk menentukur pembesar suara anda.",
    no: "⚠ Fordi denne studien vil kalibrere mikrofoner (_calibratesoundmicrophonesbool == true), trenger du en USB-mikrofon (MinidSP UMIK-1 eller UMIK-2) for å kalibrere høyttalerne dine.",
    fa: "⚠ از آنجا که این مطالعه میکروفون ها را کالیبره می کند (_calibratesoundmicrophonesbool == true) ، برای کالیبراسیون بلندگوهای خود به میکروفون USB (minidsp umik-1 یا umik-2) نیاز خواهید داشت.",
    pl: "⚠ Ponieważ to badanie kalibruje mikrofony (_calibratesoundmicrofonesbool == true), będziesz potrzebować mikrofonu USB (MINIDSP Umik-1 lub Umik-2), aby kalibrować twoje głośniki.",
