    tr: "⚠ Bu çalışma mikrofonları kalibre edeceğinden (_calibratesoundmicrophonesbool == true), hoparlörlerinizi kalibre etmek için bir USB mikrofonuna (miniDSP UMIK-1 veya UMIK-2) ihtiyacınız olacaktır.",
