    fa: "بیایید به کتابخانه پروفایل بپردازیم که با میکروفون تلفن شما مطابقت داشته باشد. دوربین تلفن خود را در کد QR زیر قرار دهید و روی پیوندی که در صفحه تلفن شما ظاهر می شود ضربه بزنید.",
