    ro: "Să ne uităm în biblioteca de profil pentru unul care se potrivește cu microfonul telefonului. Indicați camera telefonului dvs. la codul QR de mai jos și atingeți linkul care apare în ecranul telefonului.",
    ru: "Давайте посмотрим в библиотеку профилей для той, которая соответствует микрофону вашего телефона. Укажите камеру вашего телефона на QR -код ниже и нажмите на ссылку, которая появляется на экране вашего телефона.",
