    su: "Teundeun telepon ieu dina kaca, MId, atanapi ngadamel deui telepon ieu contona pertengnekkeun ku kituna mikropon mangrupikeun jalur, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard, anu biasana dina keyboard. Pencét Over.",
    sw: "Weka simu hii kwenye glasi, mug, au unaweza na uelekeze makali ya simu ⇧ kwenye kompyuta yako ili kipaza sauti iko kwenye mstari wako wa kuona kwa wasemaji, ambao kwa kawaida uko kwenye kibodi. Bonyeza endelea.",
