    el: "Για να παράγουμε ακριβείς ήχους, πρέπει να βαθμονομούμε τα μεγάφωνα. Αυτό απαιτεί ένα βαθμονομημένο μικρόφωνο. Έχετε εύχρηστο smartphone (ή USB Microphone);\n",
    he: "כדי להפיק צלילים מדויקים, עלינו לכייל את הרמקולים. זה דורש מיקרופון מכויל. האם יש לך סמארטפון (או מיקרופון USB) שימושי?\n",
    hi: "सटीक ध्वनियों का उत्पादन करने के लिए, हमें लाउडस्पीकरों को जांचने की आवश्यकता है। इसके लिए एक कैलिब्रेटेड माइक्रोफोन की आवश्यकता होती है। क्या आपके पास एक स्मार्टफोन (या USB माइक्रोफोन) है?\n",
    hu: "A pontos hangok előállításához a hangszórókat kalibrálni kell. Ehhez kalibrált mikrofon szükséges. Van -e okostelefon (vagy USB mikrofon)?\n",
    is: "Til að framleiða nákvæm hljóð þurfum við að kvarða hátalarana. Þetta krefst kvarðaðs hljóðnema. Ertu með snjallsíma (eða USB hljóðnemann) vel?\n",
    id: "Untuk menghasilkan suara yang akurat, kita perlu mengkalibrasi pengeras suara. Ini membutuhkan mikrofon yang dikalibrasi. Apakah Anda memiliki smartphone (atau mikrofon USB) yang berguna?\n",
    it: "Per produrre suoni accurati, dobbiamo calibrare gli altoparlanti. Ciò richiede un microfono calibrato. Hai a portata di mano uno smartphone (o un microfono USB)?\n",
    ja: "正確なサウンドを生成するには、スピーカーを調整する必要があります。これには、キャリブレーションされたマイクが必要です。スマートフォン（またはUSBマイク）が便利ですか？\n",
