    ko: "정확한 사운드를 생성하려면 라우드 스피커를 교정해야합니다. 이를 위해서는 교정 마이크가 필요합니다. 스마트 폰 (또는 USB 마이크)이 편리합니까?\n",
    lt: "Norėdami gauti tikslius garsus, turime kalibruoti garsiakalbius. Tam reikia kalibruoto mikrofono. Ar turite patogų išmanųjį telefoną (arba USB mikrofoną)?\n",
    ms: "Untuk menghasilkan bunyi yang tepat, kita perlu menentukur pembesar suara. Ini memerlukan mikrofon yang dikalibrasi. Adakah anda mempunyai telefon pintar (atau mikrofon USB) yang berguna?\n",
    no: "For å produsere nøyaktige lyder, må vi kalibrere høyttalerne. Dette krever en kalibrert mikrofon. Har du en smarttelefon (eller USB -mikrofon) praktisk?\n",
    fa: "برای تولید صداهای دقیق ، باید بلندگوها را کالیبره کنیم. این به میکروفون کالیبره شده نیاز دارد. آیا تلفن هوشمند (یا میکروفون USB) مفید دارید؟\n",
    pl: "Aby uzyskać dokładne dźwięki, musimy kalibrować głośniki. Wymaga to skalibrowanego mikrofonu. Czy masz pod ręką smartfon (lub mikrofon USB)?\n",
    pt: "Para produzir sons precisos, precisamos calibrar os alto -falantes. Isso requer um microfone calibrado. Você tem um smartphone (ou microfone USB) à mão?\n",
    ro: "Pentru a produce sunete precise, trebuie să calibrăm difuzoarele. Acest lucru necesită un microfon calibrat. Aveți la îndemână un smartphone (sau microfon USB)?\n",
    ru: "Чтобы произвести точные звуки, нам нужно калибровать громкоговорители. Это требует калиброванного микрофона. У вас есть смартфон (или USB -микрофон)?\n",
    sr: "Да бисмо произвели тачне звукове, морамо да калибришемо звучнике. Ово захтева калибрирани микрофон. Имате ли хањуино паметни телефон (или УСБ микрофон)?\n",
    es: "Para producir sonidos precisos, necesitamos calibrar los altavoces. Esto requiere un micrófono calibrado. ¿Tiene un teléfono inteligente (o micrófono USB) a mano?\n",
    su: "Ngahasilkeun sora akurat, urang kedah calibrate tina spiker. Ieu butuh mikropon anu kalibrasi. Dupi anjeun ngagaduhan smartphone (atanapi Micopton USB)?\n",
    sw: "Ili kutoa sauti sahihi, tunahitaji kudhibiti vipaza sauti. Hii inahitaji kipaza sauti kilicho na kipimo. Je! Unayo smartphone (au kipaza sauti ya USB)?\n",
    sv: "För att producera exakta ljud måste vi kalibrera högtalarna. Detta kräver en kalibrerad mikrofon. Har du en smartphone (eller USB -mikrofon) praktiskt?\n",
    tr: "Doğru sesler üretmek için hoparlörleri kalibre etmemiz gerekir. Bu kalibre edilmiş bir mikrofon gerektirir. Bir akıllı telefonunuz (veya USB mikrofonunuz) kullanışlı mı?\n",
