    hy: "Եթե ​​այս էկրանը սառեցնում է, խնդրում ենք վերամիավորել, մատնանշելով ձեր սմարթֆոնների ֆոտոխցիկը QR կոդում ձեր համակարգչի էկրանին: Երբ հղումը հայտնվում է, դիպչեք ձեր մատով:",
    bg: "Ако този екран замръзне, моля, свържете се, като насочите камерата на вашия смартфон на QR кода на екрана на вашия компютър. Когато се появи връзка, докоснете го с пръста си.",
    "zh-CN":
      "如果此屏幕冻结，请通过将智能手机相机指向计算机屏幕上的QR码来重新连接。出现链接时，用手指触摸它。",
    "zh-HK":
      "如果此屏幕凍結，請通過將智能手機相機指向計算機屏幕上的QR碼來重新連接。出現鏈接時，用手指觸摸它。",
    hr: "Ako se ovaj zaslon zamrzava, ponovno se spojite pokazujući kameru pametnih telefona na QR kôd na zaslonu računala. Kad se pojavi veza, dodirnite je prstom.",
    cs: "Pokud tato obrazovka zamrzne, znovu se připojte namířením kamery smartphonu na QR kód na obrazovce počítače. Když se objeví odkaz, dotkněte se ho prstem.",
    da: "Hvis denne skærm fryser, skal du oprette forbindelse igen ved at pege dit smartphone -kamera på QR -koden på din computerskærm. Når der vises et link, skal du røre ved det med din finger.",
    nl: "Als dit scherm wordt vastgelegd, maak u opnieuw verbinding door uw smartphonecamera te richten op de QR -code op uw computerscherm. Wanneer een link verschijnt, raak deze aan met uw vinger.",
    "en-UK":
      "If this screen freezes, please reconnect by pointing your smartphone camera at the QR code on your computer screen. When a link appears, touch it with your finger.",
    "en-US_1":
      "If this screen freezes, please reconnect by pointing your smartphone camera at the QR code on your computer screen. When a link appears, touch it with your finger.",
    fi: "Jos tämä näyttö jäädyttää, kytke uudelleen osoittamalla älypuhelinkamerasi QR -koodiin tietokoneen näytöllä. Kun linkki tulee näkyviin, kosketa sitä sormellasi.",
    fr: "Si cet écran gèle, veuillez vous reconnecter en pointant votre appareil photo pour smartphone sur le code QR sur l'écran de votre ordinateur. Lorsqu'un lien apparaît, touchez-le avec votre doigt.",
    de: "Wenn dieser Bildschirm gefriert, verbinden Sie bitte wieder, indem Sie Ihre Smartphone -Kamera auf den QR -Code auf Ihrem Computerbildschirm zeigen. Wenn ein Link angezeigt wird, berühren Sie ihn mit Ihrem Finger.",
    el: "Εάν αυτή η οθόνη παγώσει, επανασυνδεθείτε επισημαίνοντας την κάμερα smartphone στον κωδικό QR στην οθόνη του υπολογιστή σας. Όταν εμφανιστεί ένας σύνδεσμος, αγγίξτε το με το δάχτυλό σας.",
    he: "אם מסך זה קופא, אנא התחבר מחדש על ידי הפניית מצלמת הסמארטפון שלך בקוד ה- QR במסך המחשב שלך. כאשר מופיע קישור, גע בו באצבע שלך.",
    hi: "यदि यह स्क्रीन फ्रीज हो जाती है, तो कृपया अपने कंप्यूटर स्क्रीन पर QR कोड पर अपने स्मार्टफोन कैमरे को इंगित करके फिर से कनेक्ट करें। जब कोई लिंक दिखाई देता है, तो इसे अपनी उंगली से स्पर्श करें।",
    hu: "Ha ez a képernyő lefagy, kérjük, csatlakoztassa újra az okostelefon -kamerát a számítógép képernyőjének QR -kódján. Amikor egy link megjelenik, érintse meg az ujját.",
    is: "Ef þessi skjár frýs, vinsamlegast tengdu aftur með því að beina snjallsíma myndavélinni á QR kóðann á tölvuskjánum þínum. Þegar hlekkur birtist skaltu snerta hann með fingrinum.",
    id: "Jika layar ini membeku, silakan terhubung kembali dengan mengarahkan kamera ponsel cerdas Anda di kode QR di layar komputer Anda. Saat tautan muncul, sentuh dengan jari Anda.",
    it: "Se questa schermata si blocca, si prega di riconnettersi puntando la fotocamera per smartphone sul codice QR sullo schermo del computer. Quando appare un collegamento, toccalo con il dito.",
    ja: "この画面がフリーズした場合は、コンピューター画面のQRコードにスマートフォンカメラを向けて再接続してください。リンクが表示されたら、指で触れます。",
