    ko: "연결이 손실되었습니다. 컴퓨터 화면의 QR 코드에서 스마트 폰 카메라를 가리키면 다시 연결하십시오. 링크가 나타나면 손가락으로 터치하십시오.",
    lt: "Ryšys buvo prarastas. Prašome vėl prisijungti, nurodydami savo išmaniojo telefono fotoaparatą į QR kodą kompiuterio ekrane. Kai pasirodys nuoroda, palieskite jį pirštu.",
    ms: "Sambungan hilang. Sila sambungkan semula dengan menunjuk kamera telefon pintar anda di kod QR pada skrin komputer anda. Apabila pautan muncul, sentuh dengan jari anda.",
    no: "Forbindelsen gikk tapt. Vennligst koble til igjen ved å peke smarttelefonkameraet på QR -koden på dataskjermen. Når en lenke vises, berør den med fingeren.",
    fa: "اتصال از بین رفت. لطفاً با اشاره به دوربین تلفن هوشمند خود در کد QR در صفحه رایانه خود ، دوباره وصل کنید. وقتی پیوندی ظاهر می شود ، آن را با انگشت خود لمس کنید.",
    pl: "Połączenie zostało utracone. Ponownie podłącz się, wskazując aparat smartfona na kod QR na ekranie komputera. Kiedy pojawi się link, dotknij go palcem.",
