    fa: "آماده؟ برای ردیابی مرکز موهای متقاطع تا زمانی که هدف ظاهر شود ، از مکان نما استفاده کنید. وقتی مکان نما روی آن قرار دارد موهای متقاطع جسورانه می شوند.",
    pl: "Gotowy? Użyj kursora, aby śledzić środek włosów krzyżowych, aż pojawi się cel. Krzyżowe włosy stają się odważne, gdy jest na nim kursor.",
    pt: "Preparar? Use o cursor para rastrear o centro do cabelo cruzado até que o alvo apareça. O cabelo cruzado fica ousado quando o cursor está nele.",
    ro: "Gata? Folosiți cursorul pentru a urmări centrul părului încrucișat până când apare ținta. Părul încrucișat devine îndrăzneț atunci când cursorul este pe el.",
    ru: "Готовый? Используйте курсор, чтобы отслеживать центр кросс -волос, пока не появится цель. Крестные волосы становятся смелыми, когда курсор на нем.",
    sr: "Спремни? Употријебите курсор да бисте пратили средину крстове косе док се не појави циљ. Укрштена коса постаје смела када је курсор на њему.",
    es: "¿Listo? Use el cursor para rastrear el centro de la cruz hasta que aparezca el objetivo. El cabello cruzado se vuelve audaz cuando el cursor está sobre él.",
    su: "Siap? Anggo kursor pikeun ngalacak pusat buuk buaya dugi ka udagan bijil. Rambut salib janten wani nalika kursor aya di dinya.",
    sw: "Tayari? Tumia mshale kufuatilia katikati ya nywele za msalaba hadi lengo lionekane. Nywele za msalaba huwa ujasiri wakati mshale uko juu yake.",
    sv: "Redo? Använd markören för att spåra mitten av korshåret tills målet visas. Korshåret blir djärvt när markören är på den.",
    tr: "Hazır? Hedef görünene kadar çapraz saçların merkezini izlemek için imleci kullanın. İmleç üzerindeyken çapraz saç kalınlaşır.",
    ur: "تیار؟ کراس بالوں کے مرکز کو ٹریک کرنے کے لئے کرسر کا استعمال کریں جب تک کہ ہدف ظاہر نہ ہو۔ جب کرسر اس پر ہوتا ہے تو کراس کے بال جرات مند ہوجاتے ہیں۔",
